import React from 'react';

const TodoContainer = ({ todo, setTodos }) => {
  return (
    <div className='todoContainer'>
      <div>
        <input
          type='text'
          className='todoContainer_title'
          value={todo.title}
          onChange={(e) => {
            setTodos;
          }}
        />
      </div>
      <div>
        <textarea
          className='todoContainer_body'
          value={todo.content}
        ></textarea>
      </div>
    </div>
  );
};

export default TodoContainer;
